// Verified cash manager on mainnet
// (c) Kallol Borah, 2021

pragma solidity 0.5.7;

import "./interfaces/IERC20.sol";
import "./interfaces/ViaCash.sol";
import "./interfaces/ViaBond.sol";
import "./interfaces/ViaFactory.sol";
import "./utilities/Pausable.sol";
import "./utilities/StringUtils.sol";
import "abdk-libraries-solidity/ABDKMathQuad.sol";
import "@openzeppelin/upgrades/contracts/Initializable.sol";
import "@openzeppelin/contracts-ethereum-package/contracts/ownership/Ownable.sol";

contract Cash is Initializable, Ownable, Pausable {

    using stringutils for *;

    using ABDKMathQuad for uint256;
    using ABDKMathQuad for int256;
    using ABDKMathQuad for bytes16;

    //name of Verified cash token (eg, Via-USD)
    string public name;
    string public symbol;
    bytes32 public cashtokenName;

    //verified factory address
    ViaFactory private factory;

    struct deposit{
        bytes16 depositAmount;
        bytes16 issuedAmount;
    }

    //mapping of buyers (address) to currency (bytes32) to deposits 
    mapping(address => mapping(bytes32 => deposit)) private L1deposits;
    mapping(address => mapping(bytes32 => deposit)) private L2deposits;

    //supported ERC20 tokens for issuing Verified cash tokens
    ViaCash.token[] private tokens;
    mapping(address => uint256) private tokenIndex;

    //events to capture by Verified bridge
    event CashIssueRequest(address indexed party, bytes32 currency, uint256 amount);
    event CashRedeemed(uint256 amount, address redeemer, bytes32 currency);

    modifier onlyBridge(address sender){
        
        _;
    }

    function initialize(bytes32 _name, bytes32 _currency, address _owner) public initializer{
        Ownable.initialize(_owner);
        factory = ViaFactory(msg.sender);
        name = string(abi.encodePacked(_name));
        symbol = _name.substring(0,5);
        cashtokenName = _currency;
    }

    //handling pay in of ether for issue of via cash tokens
    function() external payable{
        //ether paid in
        require(msg.value !=0);
        //only to pay in ether
        require(msg.data.length==0);
        //contract must not be paused
        require(paused == false);
        //check aml status
        //require(amlCheck(msg.sender)==true);     
        L1deposits[msg.sender]["ether"].depositAmount = ABDKMathQuad.add(L1deposits[msg.sender]["ether"].depositAmount, ABDKMathQuad.fromUInt(msg.value));    
    }

    /**
        Specifies list of supported tokens that can be deposited to issue Verified cash tokens
        @param  _token  address of token supported
        @param  _name   name of token supported
     */
    function supportTokens(address _token, bytes32 _name) onlyOwner external {
        if(tokenIndex[_token]==0){
            ViaCash.token memory t = ViaCash.token ({
                tokenName: _name,
                tokenAddress: _token
            });
            tokens.push(t);
            tokenIndex[_token] = tokens.length;
        }
    }

    /**
        Checks if a specified token is supported for issuing Verified cash tokens
        @param  _token  token that is supported for issuing cash tokens
     */
    function checkSupportForToken(address _token) external view returns(bool){
        if(tokenIndex[_token]>0)
            return true;
        else
            return false;
    }

    /**
        Used by external apps (eg, exchange, wallet) to buy Verified cash token 
        @param  _token  address of token used by investor to buy the cash token
        @param  _amount amount of token that is transferred from investor to this cash token issuing contract
     */
    function buy(address _token, uint256 _amount, address _buyer) external {
        require(paused == false, "Contract in paused state");
        bool found = false;
        if(tokenIndex[_token]>0)
            found = true;
        if(found){
            bytes32 currencyName = stringutils.stringToBytes32(IERC20(_token).name());
            if(IERC20(_token).transferFrom(msg.sender, address(this), _amount)){
                L2deposits[_buyer][currencyName].depositAmount = ABDKMathQuad.add(L2deposits[_buyer][currencyName].depositAmount, ABDKMathQuad.fromUInt(_amount));
                emit CashIssueRequest(_buyer, currencyName, _amount);
            }
        }
        else if(ABDKMathQuad.cmp(L1deposits[msg.sender]["ether"].depositAmount, ABDKMathQuad.fromUInt(_amount))>=0){
            L1deposits[msg.sender]["ether"].depositAmount = ABDKMathQuad.sub(L1deposits[msg.sender]["ether"].depositAmount, ABDKMathQuad.fromUInt(_amount));
            L2deposits[_buyer]["ether"].depositAmount = ABDKMathQuad.add(L2deposits[_buyer]["ether"].depositAmount, ABDKMathQuad.fromUInt(_amount));
            emit CashIssueRequest(_buyer, "ether", _amount);                
        }
    }

    //redeems deposited amounts
    function redeemDeposits(uint256 amount, address redeemer, bytes32 currency) onlyBridge(msg.sender) external {
        if(currency=="ether"){    
            address(uint160(redeemer)).transfer(amount);
        }
        else{
            for(uint256 i=0; i<tokens.length; i++){
                if(tokens[i].tokenName==currency)
                    IERC20(tokens[i].tokenAddress).transferFrom(address(this), redeemer, amount);
            }
        }  
        emit CashRedeemed(amount, redeemer, currency);
    }

    /*
    //stores deposited amounts and currencies on L2 and L1 networks
    function addDeposit(bytes16 amount, address buyer, bytes32 currency) private {
        if(factory.getIssuer("ViaCash", currency)==address(this))
            L2deposits[buyer][currency].depositAmount = ABDKMathQuad.add(L2deposits[buyer][currency].depositAmount, amount);
        else
            L1deposits[buyer][currency].depositAmount = ABDKMathQuad.add(L1deposits[buyer][currency].depositAmount, amount);
        
    }

    //handles deposit of cash tokens of other currencies deposited in L2 network for issue of this cash token
    function depositCollateral(uint256 amount, address sender, bytes32 currency) onlyBridge(msg.sender) external {
        addDeposit(ABDKMathQuad.fromUInt(amount), sender, currency);
    }

    //adds issued Verified cash tokens in L2 to user balances
    function addIssuedBalance(uint256 amount, address buyer, bytes32 currency) onlyBridge(msg.sender) external {
        if(factory.getIssuer("ViaCash", currency)==address(this))
            L2deposits[buyer][currency].issuedAmount = ABDKMathQuad.add(L2deposits[buyer][currency].issuedAmount, ABDKMathQuad.fromUInt(amount));
    }

    //transfers issued cash tokens in L2 from transferor to transferee
    function transferBalance(address transferor, uint256 amount, address transferee, bytes32 currency) onlyBridge(msg.sender) view external {
        if(factory.getIssuer("ViaCash", currency)==address(this)){
            if(ABDKMathQuad.cmp(ABDKMathQuad.sub(L2deposits[transferor][currency].issuedAmount, ABDKMathQuad.fromUInt(amount)),0)>=0)    
                ABDKMathQuad.add(L2deposits[transferee][currency].issuedAmount, ABDKMathQuad.fromUInt(amount));
        }
    }

    //transfers deposit (against which cash tokens are issued) from transferor to transferee   
    function transferDeposit(address transferor, uint256 amount, address transferee, bytes32 currency) onlyBridge(msg.sender) view external {
        if(factory.getIssuer("ViaCash", currency)==address(this)){
            if(ABDKMathQuad.cmp(ABDKMathQuad.sub(L2deposits[transferor][currency].depositAmount, ABDKMathQuad.fromUInt(amount)),0)>=0)    
                ABDKMathQuad.add(L2deposits[transferee][currency].depositAmount, ABDKMathQuad.fromUInt(amount));
        }
        else{
            if(ABDKMathQuad.cmp(ABDKMathQuad.sub(L1deposits[transferor][currency].depositAmount, ABDKMathQuad.fromUInt(amount)),0)>=0)    
                ABDKMathQuad.add(L1deposits[transferee][currency].depositAmount, ABDKMathQuad.fromUInt(amount));
        }
    }

    //redeems issued cash token balance
    function redeemIssuedBalance(uint256 amount, address redeemer, bytes32 currency) onlyBridge(msg.sender) external {
        if(ABDKMathQuad.cmp(L2deposits[redeemer][currency].issuedAmount,ABDKMathQuad.fromUInt(0))>=0){
            L2deposits[redeemer][currency].issuedAmount = ABDKMathQuad.sub(L2deposits[redeemer][currency].issuedAmount, ABDKMathQuad.fromUInt(amount));
            if(currency=="ether"){    
                address(uint160(redeemer)).transfer(amount);
            }
            else{
                IERC20(redeemer).transferFrom(address(this), redeemer, amount);
            }  
        }
    }*/

    function pause() onlyOwner public {
        _pause();
    }
    function unpause() onlyOwner public {
        _unpause();
    }

}

